import { useState } from 'react';
import Button from './Button';

function App() {
    const [counter, setValue] = useState(0);
    function onClick(value) {
        setValue(counter + 1);
    }
    return (
        <div className="App">
            <h1>{counter}</h1>
            <Button onClick={onClick} text={'Continue'} />
        </div>
    );
}

export default App;
